import React from 'react';

function Footer() {
    return (
        <footer className="black text-white text-center p-4">
            <p>&copy; {new Date().getFullYear()} Gramps of Tennessee. All rights reserved.</p>
            {/* Add additional footer content here */}
        </footer>
    );
}

export default Footer;
